import React, { useState } from 'react';
import {StyleSheet, Text, View, Image, TextInput, Button } from 'react-native';
import {Ionicons} from '@expo/vector-icons';
import APIKit, {setClientToken} from '../src/services/vjezbe'
import loginServer from '../src/services/login'
import vjezbeServer from '../src/services/vjezbe'
import { AsyncStorage } from '@react-native-community/async-storage';

const initialState = {
  username: '',
  pass: '',
  errors: {},
  isAuthorized: false,
  isLoading: false,
};

const Login = (props) => {
  const [username, postaviUsername] = useState('')
  const [pass, postaviPass] = useState('')
  const [korisnik, postaviKorisnika] = useState(null)
  const noviUsername = (tekst) => {
    postaviUsername(tekst)
  }
  const novaPass= (tekst) => {
    postaviPass(tekst)
  }

const userLogin = async (e) => {
  e.preventDefault()
  try {
    const korisnik= await loginServer.prijava({username, pass})
    vjezbeServer.postaviToken(korisnik.token)
    //moram spremit taj podatak trajno, key-value parovi
    await AsyncStorage.setItem(
      'prijavljeniKorisnik',
      JSON.stringify(korisnik)
    );
    postaviKorisnika(korisnik)
    props.navigation.navigate("App");
    postaviUsername(''),
    postaviPass('')
  }
  catch(exception) {
    alert("Neispravni podaci. Korisnik ne postoji u bazi.")
  }
}

  return (
    <View style={stil.ekran}>
      <Image style={stil.slika} source={ require('../constants/images/image.jpg')} />
      <Text style= { stil.naslov}>FITNESS </Text>
      <Text style= { stil.opis}> 
        Prilagodite se kuÄ‡nim vjezbama i videozapisima-
        Cardio, Pilates, HIIT, i ostalo
      </Text>

    <View >
      <View style= {stil.unos}>
      <Ionicons style= {stil.ikona} IconComponent={Ionicons} name="mail" />
      <TextInput style= {stil.input} value={username} name="Username" onChangeText={noviUsername} />
      </View>

      <View style= {stil.unos}>
      <Ionicons style= {stil.ikona} IconComponent={Ionicons} name="lock-closed" />
      <TextInput style= {stil.input} secureTextEntry name="Password" value={pass} onChangeText={novaPass} />
      </View>
      </View>
<View style= {stil.natpis}>
<Text style={ stil.tekst} onPress={userLogin} > Already a member </Text>
</View>
<Text onPress= {() => {
props.navigation.navigate({ routeName: "Register" })} }
style= {stil.novi}> New user </Text>
    </View>
  );
};
Login.navigationOptions= {
  headerShown:false
}
const stil = StyleSheet.create({
  novi: {
    alignSelf: 'center',
    color:'#FE2F57',
    fontFamily:'open-sans',
    paddingVertical: 30
  },
  natpis: {
    marginHorizontal:55,
    alignItems:'center',
    justifyContent:'center',
    marginTop:20,
    backgroundColor: '#FE2F57',
    paddingVertical:10,
    borderRadius: 23,

  },
  tekst: {
    color: 'white',
    fontFamily: 'open-sans'
  },
  input: {
    paddingHorizontal: 10
  },
  ikona: {
    color: '#FE2F57',
    
  },
  unos:{
    flexDirection: 'row',
    alignItems: 'center',
    marginHorizontal: 55,
    borderWidth: 2,
    marginTop:15,
    paddingHorizontal: 10,
    borderColor: '#FE2F57',
    borderRadius: 23,
    paddingVertical: 2
  },
  opis: {
    alignSelf: 'center',
    fontFamily: 'open-sans',
    marginHorizontal:55,
    marginTop: 5,
    opacity: 0.5
  },
  naslov: {
    fontSize: 30,
    fontFamily: 'open-sans-bold',
    alignSelf: 'center'
  },
  slika: {
    width: '100%',
    height: '45%'
  },
  ekran: {
    backgroundColor: '#fff',
    height: '100%',
  },
});

export default Login
